import React from 'react';

import Experience from './experience/Experience'
import styles from './Experiences.module.css'

const experiences = () => {
    return (
        <div className={styles.experiences}>
            <Experience
                company='Visa'
            >
            <ul>
                <li>To be honest with you, I have no idea of what I will be working on there, but Jesus will lead the way</li>
                <li>To be honest with you, I have no idea of what I will be working on there, but Jesus will lead the way</li>
            </ul>
            </Experience>
        </div>
    )
}

export default experiences;
